import{_ as n,Y as t,Z as a,$ as s,a0 as r,a1 as e,a2 as c,F as i}from"./framework-c4f4fa2e.js";const l={},d=e("p",null,"Nengo Brain Maker 是一个用于构建、测试和部署神经网络的 Python 包。",-1),m=e("h2",{id:"简介",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#简介","aria-hidden":"true"},"#"),c(" 简介")],-1),_=e("p",null,"Nengo 是一个用于构建和模拟大规模神经认知系统（neural cognitive systems）的开源软件平台和编程语言。它基于生物神经网络的设计理念，旨在帮助用户更加高效地构建和实现生物神经网络模型，并进行仿真和分析。Nengo 的设计思想是通过构建一系列神经元集群来实现复杂的计算，每个神经元集群都相当于大脑中的一个神经元或神经元群，这些神经元集群可以通过突触连接彼此传递信息和执行计算任务。与其他神经网络模拟器相比，Nengo 具有可扩展、高效、灵活和易于调试等特点。Nengo 能够应用于多种领域，如视觉处理、语言学习、孪生神经网络等，为研究人员和开发人员提供了强大的工具和平台。",-1);function h(g,p){const o=i("Presentation");return t(),a("div",null,[d,s(" more "),m,_,r(o,{id:"presentation-10",code:"",theme:"auto"})])}const f=n(l,[["render",h],["__file","nengo.html.vue"]]);export{f as default};
